import React from 'react'
import { Video } from 'grommet';
import { storiesOf } from '@storybook/react';

export const Vid = () => {
    return (
        <Video controls="over" fit="cover">
            <source key="video" src="./kaaris.mp4" type="video/mp4" />
        </Video>
    )
}

storiesOf('Video', module)
  .add('Simple', () => <Vid />)

export default Vid
